window.bookSummaryJSON = "<p><i>The Power of Your Subconscious Mind </i>introduces and explains the mind-focusing techniques that remove the subconscious obstacles that prevent us from achieving the success we want - and deserve.&nbsp;</p> <p>This authorized edition of Dr. Murphy's keystone work is the first premium mass-market edition to feature additional commentary drawn from his unpublished writings. As practical as it is inspiring, Dr. Murphy's work demonstrates with real-life examples the way to unleash extraordinary mental powers to build self-confidence, create harmonious relationships, gain professional success, amass wealth, conquer fears and phobias, banish bad habits, and even to affect physical healing and promote overall well-being and happiness.&nbsp;</p>"; 
